from sympy import factorint, prime, primepi
from sympy.ntheory.factor_ import core
from operator import mul
def a003961(n):
    f=factorint(n)
    return 1 if n==1 else reduce(mul, [prime(primepi(i) + 1)**f[i] for i in f])
def a242378(k, n):
    while k>0:
        n=a003961(n)
        k-=1
    return n
